import React, { useState } from "react";

function MemberList(props) {
  return (
    <>
      {props.memberList.map((member, index) => (
        <div>
          key= {index}
          name = {member.name}
          email = {member.email}
          role = {member.role}
        </div>
      ))}
    </>
  );
}

export default MemberList;
